    "Additional Information": "\u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10d7\u10d8 \u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d0",
    "Admin": "\u10d0\u10d3\u10db\u10d8\u10dc\u10d8\u10e1\u10e2\u10e0\u10d0\u10e2\u10dd\u10e0\u10d8",
    "Advanced": "\u10d2\u10d0\u10dc\u10d5\u10d8\u10d7\u10d0\u10e0\u10d4\u10d1\u10e3\u10da\u10d8 \u10d3\u10dd\u10dc\u10d4",
    "After the subsection\\'s due date has passed, learners can no longer access its content. The subsection remains included in grade calculations.": "\u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d8\u10e1 \u10e1\u10d0\u10d1\u10dd\u10da\u10dd\u10dd \u10d5\u10d0\u10d3\u10d8\u10e1 \u10d2\u10d0\u10e1\u10d5\u10da\u10d8\u10e1 \u10e8\u10d4\u10db\u10d3\u10d4\u10d2, \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10e1 \u10db\u10d8\u10e1 \u10e8\u10d8\u10d2\u10d7\u10d0\u10d5\u10e1\u10d7\u10d0\u10dc \u10ec\u10d5\u10d3\u10dd\u10db\u10d0 \u10d0\u10e6\u10d0\u10e0 \u10e8\u10d4\u10d4\u10eb\u10da\u10d4\u10d1\u10d0\u10d7. \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d0 \u10d9\u10d5\u10da\u10d0\u10d5 \u10d2\u10d0\u10d7\u10d5\u10d0\u10da\u10d8\u10e1\u10ec\u10d8\u10dc\u10d4\u10d1\u10e3\u10da\u10d8 \u10d8\u10e5\u10dc\u10d4\u10d1\u10d0 \u10e1\u10d0\u10d1\u10dd\u10da\u10dd\u10dd \u10e8\u10d4\u10e4\u10d0\u10e1\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10d7\u10d5\u10da\u10d0\u10e8\u10d8.",
    "All Rights Reserved": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10e3\u10e4\u10da\u10d4\u10d1\u10d0 \u10d3\u10d0\u10ea\u10e3\u10da\u10d8\u10d0",
    "All Time Zones": "\u10d3\u10e0\u10dd\u10d8\u10e1 \u10e7\u10d5\u10d4\u10da\u10d0 \u10e1\u10d0\u10e0\u10e2\u10e7\u10d4\u10da\u10d8",
    "All Topics": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10e1\u10d0\u10d9\u10d8\u10d7\u10ee\u10d8",
    "All accounts were created successfully.": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10d0\u10dc\u10d2\u10d0\u10e0\u10d8\u10e8\u10d8 \u10ec\u10d0\u10e0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10d7 \u10e8\u10d4\u10d8\u10e5\u10db\u10dc\u10d0.",
    "All groups must have a name.": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10ef\u10d2\u10e3\u10e4\u10e1 \u10e3\u10dc\u10d3\u10d0 \u10e5\u10dd\u10dc\u10d3\u10d4\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8.",
    "All groups must have a unique name.": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10ef\u10d2\u10e3\u10e4\u10e1 \u10e3\u10dc\u10d8\u10d9\u10d0\u10da\u10e3\u10e0\u10d8 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10e3\u10dc\u10d3\u10d0 \u10e5\u10dd\u10dc\u10d3\u10d4\u10e1.",
    "All learners in the {cohort_name} cohort": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d8 {cohort_name} \u10ef\u10d2\u10e3\u10e4\u10e8\u10d8",
    "All learners who are enrolled in this course": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d8 \u10d5\u10d8\u10dc\u10ea \u10e9\u10d0\u10e0\u10d8\u10ea\u10ee\u10e3\u10da\u10d8\u10d0 \u10d0\u10db \u10d9\u10e3\u10e0\u10e1\u10d6\u10d4",
    "All payment options are currently unavailable.": "\u10d0\u10db\u10df\u10d0\u10db\u10d0\u10d3 \u10d2\u10d0\u10d3\u10d0\u10ee\u10d3\u10d8\u10e1 \u10e7\u10d5\u10d4\u10da\u10d0 \u10d5\u10d0\u10e0\u10d8\u10d0\u10dc\u10e2\u10d8 \u10db\u10d8\u10e3\u10ec\u10d5\u10d3\u10dd\u10db\u10d4\u10da\u10d8\u10d0.",
    "All professional education courses are fee-based, and require payment to complete the enrollment process.": "\u10de\u10e0\u10dd\u10e4\u10d4\u10e1\u10d8\u10e3\u10da\u10d8 \u10d2\u10d0\u10dc\u10d0\u10d7\u10da\u10d4\u10d1\u10d8\u10e1 \u10e7\u10d5\u10d4\u10da\u10d0 \u10d9\u10e3\u10e0\u10e1\u10d8 \u10e4\u10d0\u10e1\u10d8\u10d0\u10dc\u10d8\u10d0 \u10d3\u10d0 \u10e9\u10d0\u10e0\u10d8\u10ea\u10ee\u10d5\u10d8\u10e1 \u10de\u10e0\u10dd\u10ea\u10d4\u10e1\u10d8\u10e1 \u10d3\u10d0\u10e1\u10d0\u10e1\u10e0\u10e3\u10da\u10d4\u10d1\u10da\u10d0\u10d3, \u10d0\u10e3\u10ea\u10d8\u10da\u10d4\u10d1\u10d4\u10da\u10d8\u10d0 \u10d7\u10d0\u10dc\u10ee\u10d8\u10e1 \u10d2\u10d0\u10d3\u10d0\u10ee\u10d3\u10d0.",
    "All subsections": "\u10e7\u10d5\u10d4\u10da\u10d0 \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d0",
