    "Blockquote (Ctrl+Q)": "\u10ea\u10d8\u10e2\u10d0\u10e2\u10d8\u10e1 \u10d1\u10da\u10dd\u10d9\u10d8 (Ctrl+Q)",
    "Bold (Ctrl+B)": "\u10db\u10e3\u10e5\u10d8 \u10e2\u10d4\u10e5\u10e1\u10e2\u10d8 (Ctrl+B)",
    "Bookmarked": "\u10e1\u10d0\u10dc\u10d8\u10e8\u10dc\u10d4\u10d4\u10d1\u10e8\u10d8 \u10e8\u10d4\u10dc\u10d0\u10ee\u10e3\u10da\u10d8",
    "Bookmarked on": "\u10db\u10dd\u10dc\u10d8\u10e8\u10dc\u10e3\u10da\u10d8",
    "Browse": "\u10d3\u10d0\u10d7\u10d5\u10d0\u10da\u10d8\u10d4\u10e0\u10d4\u10d1\u10d0",
    "Browse recently launched courses and see what\\'s new in your favorite subjects": "\u10d3\u10d0\u10d0\u10d7\u10d5\u10d0\u10da\u10d8\u10d4\u10e0\u10d4\u10d7 \u10d0\u10ee\u10da\u10d0\u10ee\u10d0\u10dc\u10e1 \u10d3\u10d0\u10ec\u10e7\u10d4\u10d1\u10e3\u10da\u10d8 \u10d9\u10e3\u10e0\u10e1\u10d4\u10d1\u10d8 \u10d3\u10d0 \u10dc\u10d0\u10ee\u10d4\u10d7 \u10e0\u10d0 \u10e1\u10d8\u10d0\u10ee\u10da\u10d4\u10d4\u10d1\u10d8\u10d0 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d7\u10d5\u10d8\u10e1 \u10e1\u10d0\u10d8\u10dc\u10e2\u10d4\u10e0\u10d4\u10e1\u10dd \u10e1\u10d0\u10d2\u10dc\u10d4\u10d1\u10e8\u10d8",
    "Bulk Exceptions": "\u10db\u10d7\u10d4\u10da\u10d8 \u10e0\u10d8\u10d2\u10d8 \u10d2\u10d0\u10db\u10dd\u10dc\u10d0\u10d9\u10da\u10d8\u10e1\u10d4\u10d1\u10d8",
    "Bulleted List (Ctrl+U)": "\u10d1\u10e3\u10e0\u10d7\u10e3\u10da\u10d4\u10d1\u10d8\u10d0\u10dc\u10d8 \u10e1\u10d8\u10d0 (Ctrl+U)",
    "Can we match the photo you took with the one on your ID?": "\u10e8\u10d4\u10d8\u10eb\u10da\u10d4\u10d1\u10d0 \u10e8\u10d4\u10d5\u10d0\u10d3\u10d0\u10e0\u10dd\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d2\u10d0\u10d3\u10d0\u10e6\u10d4\u10d1\u10e3\u10da\u10d8 \u10e4\u10dd\u10e2\u10dd \u10d7\u10e5\u10d5\u10d4\u10dc \u10de\u10d8\u10e0\u10d0\u10d3\u10dd\u10d1\u10d8\u10e1 \u10db\u10dd\u10ec\u10db\u10dd\u10d1\u10d0\u10d6\u10d4 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da \u10e4\u10dd\u10e2\u10dd\u10e1?",
    "Cancel": "\u10d2\u10d0\u10e3\u10e5\u10db\u10d4\u10d1\u10d0",
