    "Cancel team creating.": "\u10d2\u10e3\u10dc\u10d3\u10d8\u10e1 \u10e8\u10d4\u10e5\u10db\u10dc\u10d8\u10e1 \u10d2\u10d0\u10e3\u10e5\u10db\u10d4\u10d1\u10d0.",
    "Cancel team updating.": "\u10d2\u10e3\u10dc\u10d3\u10d8\u10e1 \u10d2\u10d0\u10dc\u10d0\u10ee\u10da\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10e3\u10e5\u10db\u10d4\u10d1\u10d0.",
    "Cannot delete when in use by a unit": "\u10ec\u10d0\u10e8\u10da\u10d0 \u10e8\u10d4\u10e3\u10eb\u10da\u10d4\u10d1\u10d4\u10da\u10d8\u10d0, \u10e1\u10d0\u10dc\u10d0\u10db \u10db\u10d0\u10e1 \u10d1\u10da\u10dd\u10d9\u10d8 \u10d8\u10e7\u10d4\u10dc\u10d4\u10d1\u10e1",
    "Cannot delete when in use by an experiment": "\u10ec\u10d0\u10e8\u10da\u10d0 \u10e8\u10d4\u10e3\u10eb\u10da\u10d4\u10d1\u10d4\u10da\u10d8\u10d0, \u10e1\u10d0\u10dc\u10d0\u10db \u10db\u10d0\u10e1 \u10d4\u10e5\u10e1\u10de\u10d4\u10e0\u10d8\u10db\u10d4\u10dc\u10e2\u10d8 \u10d8\u10e7\u10d4\u10dc\u10d4\u10d1\u10e1",
    "Cannot drop more <%= types %> assignments than are assigned.": "\u10e8\u10d4\u10e3\u10eb\u10da\u10d4\u10d1\u10d4\u10da\u10d8\u10d0 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d6\u10d4 \u10db\u10d4\u10e2\u10d8 <%= types %> \u10d3\u10d0\u10d5\u10d0\u10da\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10ea\u10ee\u10e0\u10d8\u10da\u10d5\u10d0.",
    "Caution: The last published version of this unit is live. By publishing changes you will change the student experience.": "\u10e4\u10e0\u10d7\u10ee\u10d8\u10da\u10d0\u10d3: \u10d0\u10db \u10d1\u10da\u10dd\u10d9\u10d8\u10e1 \u10d1\u10dd\u10da\u10dd \u10d2\u10d0\u10db\u10dd\u10e5\u10d5\u10d4\u10e7\u10dc\u10d4\u10d1\u10e3\u10da\u10d8 \u10d5\u10d4\u10e0\u10e1\u10d8\u10d0 \u10ef\u10d4\u10e0 \u10d9\u10d8\u10d3\u10d4\u10d5 \u10d0\u10e5\u10e2\u10d8\u10e3\u10e0\u10d8\u10d0. \u10ea\u10d5\u10da\u10d8\u10da\u10d4\u10d1\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e5\u10d5\u10d4\u10e7\u10dc\u10d4\u10d1\u10d8\u10d7, \u10d7\u10e5\u10d5\u10d4\u10dc \u10e8\u10d4\u10ea\u10d5\u10da\u10d8\u10d7 \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d8\u10da\u10d4\u10d1\u10d0\u10e1.",
    "Certificate Details": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10d3\u10d4\u10e2\u10d0\u10da\u10d4\u10d1\u10d8",
    "Certificate Generated": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10d2\u10d4\u10dc\u10d4\u10e0\u10d0\u10ea\u10d8\u10d0",
    "Certificate Information": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d0",
    "Certificate Name": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8",
    "Certificate Signatories": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10ee\u10d4\u10da\u10db\u10dd\u10ec\u10d4\u10e0\u10d4\u10d1\u10d8",
    "Certificate Signatory Configuration": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10ee\u10d4\u10da\u10db\u10dd\u10ec\u10d4\u10e0\u10d8\u10e1 \u10d9\u10dd\u10dc\u10e4\u10d8\u10d2\u10e3\u10e0\u10d0\u10ea\u10d8\u10d0",
    "Certificate has been successfully invalidated for <%= user %>.": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8 <%= user %> -\u10d7\u10d5\u10d8\u10e1 \u10ec\u10d0\u10e0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10d7 \u10d2\u10d0\u10e3\u10e5\u10db\u10d3\u10d0.",
    "Certificate name is required.": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10e1\u10d0\u10d5\u10d0\u10da\u10d3\u10d4\u10d1\u10e3\u10da\u10dd\u10d0.",
    "Certificate of <%= user %> has already been invalidated. Please check your spelling and retry.": "<%= user %> -\u10d8\u10e1  \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8 \u10e3\u10d9\u10d5\u10d4 \u10d2\u10d0\u10e3\u10e5\u10db\u10d4\u10d1\u10e3\u10da\u10d8\u10d0. \u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10e8\u10d4\u10d0\u10db\u10dd\u10ec\u10db\u10dd\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10db\u10d0\u10e0\u10d7\u10da\u10ec\u10d4\u10e0\u10d0 \u10d3\u10d0 \u10d9\u10d8\u10d3\u10d4\u10d5 \u10e1\u10ea\u10d0\u10d3\u10dd\u10d7.",
    "Change Enrollment": "\u10e0\u10d4\u10d2\u10d8\u10e1\u10e2\u10e0\u10d0\u10ea\u10d8\u10d8\u10e1 \u10ea\u10d5\u10da\u10d8\u10da\u10d4\u10d1\u10d0",
