    "Change My Email Address": "\u10e8\u10d4\u10ea\u10d5\u10d0\u10da\u10d4 \u10e9\u10d4\u10db\u10d8 \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d8\u10e1 \u10db\u10d8\u10e1\u10d0\u10db\u10d0\u10e0\u10d7\u10d8",
    "Change image": "\u10e1\u10e3\u10e0\u10d0\u10d7\u10d8\u10e1 \u10e8\u10d4\u10ea\u10d5\u10da\u10d0",
    "Changes to steps that are not selected as part of the assignment will not be saved.": "\u10e1\u10d0\u10e4\u10d4\u10ee\u10e3\u10e0\u10d4\u10d1\u10e8\u10d8, \u10e0\u10dd\u10db\u10da\u10d4\u10d1\u10d8\u10ea \u10d0\u10e0 \u10d0\u10e0\u10d8\u10d0\u10dc \u10db\u10dd\u10dc\u10d8\u10e8\u10dc\u10e3\u10da\u10d8, \u10e0\u10dd\u10d2\u10dd\u10e0\u10ea \u10db\u10dd\u10ea\u10d4\u10db\u10e3\u10da\u10d8 \u10d3\u10d0\u10d5\u10d0\u10da\u10d4\u10d1\u10d8\u10e1 \u10dc\u10d0\u10ec\u10d8\u10da\u10d8, \u10ea\u10d5\u10da\u10d8\u10da\u10d4\u10d1\u10d4\u10d1\u10d8 \u10d0\u10e0 \u10e8\u10d4\u10d8\u10dc\u10d0\u10ee\u10d4\u10d1\u10d0.",
    "Chapter Asset": "\u10d7\u10d0\u10d5\u10d8\u10e1 \u10db\u10d0\u10e1\u10d0\u10da\u10d0",
    "Chapter Name": "\u10d7\u10d0\u10d5\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8",
    "Chapter information": "\u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d0 \u10d7\u10d0\u10d5\u10d8\u10e1 \u10e8\u10d4\u10e1\u10d0\u10ee\u10d4\u10d1",
    "Chapter {order}": "\u10d7\u10d0\u10d5\u10d8 {order}",
    "Check Your Email": "\u10e8\u10d4\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d7 \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d0",
    "Check the highlighted fields below and try again.": "\u10db\u10dd\u10dc\u10d8\u10e8\u10dc\u10d4\u10d7 \u10e5\u10d5\u10d4\u10db\u10dd\u10d7 \u10db\u10dd\u10ea\u10d4\u10db\u10e3\u10da\u10d8 \u10d0\u10db\u10dd\u10dc\u10d0\u10d7\u10d4\u10d1\u10e3\u10da\u10d8 \u10d5\u10d4\u10da\u10d4\u10d1\u10d8 \u10d3\u10d0 \u10d9\u10d8\u10d3\u10d4\u10d5 \u10e1\u10ea\u10d0\u10d3\u10d4\u10d7.",
