    "Do you want to replace the edX transcript with the YouTube transcript?": "\u10d2\u10e1\u10e3\u10e0\u10d7 edX \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 YouTube \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10d7 \u10e9\u10d0\u10dc\u10d0\u10ea\u10d5\u10da\u10d4\u10d1\u10d0?",
    "Do you want to upload your file before submitting?": "\u10d2\u10e1\u10e3\u10e0\u10d7 \u10de\u10d0\u10e1\u10e3\u10ee\u10d8\u10e1 \u10d2\u10d0\u10d2\u10d6\u10d0\u10d5\u10dc\u10d0\u10db\u10d3\u10d4 \u10e4\u10d0\u10d8\u10da\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0?",
    "Does the name on your ID match your account name: %(fullName)s?": "\u10d4\u10db\u10d7\u10ee\u10d5\u10d4\u10d5\u10d0 \u10d7\u10e3 \u10d0\u10e0\u10d0 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10de\u10d8\u10e0\u10d0\u10d3\u10dd\u10d1\u10d8\u10e1 \u10db\u10dd\u10ec\u10db\u10dd\u10d1\u10d0\u10d6\u10d4 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10d0\u10dc\u10d2\u10d0\u10e0\u10d8\u10e8\u10e8\u10d8 \u10db\u10d8\u10d7\u10d8\u10d7\u10d4\u10d1\u10e3\u10da \u10e1\u10d0\u10ee\u10d4\u10da\u10e1: %(fullName)s?",
