    "Don't see your picture? Make sure to allow your browser to use your camera when it asks for permission.": "\u10d5\u10d4\u10e0 \u10ee\u10d4\u10d3\u10d0\u10d5\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10e1\u10e3\u10e0\u10d0\u10d7\u10e1? \u10d3\u10d0\u10e0\u10ec\u10db\u10e3\u10dc\u10d3\u10d8\u10d7, \u10e0\u10dd\u10db \u10e0\u10dd\u10ea\u10d0 \u10d1\u10e0\u10d0\u10e3\u10d6\u10d4\u10e0\u10d8 \u10d0\u10db\u10d0\u10e1 \u10db\u10dd\u10d8\u10d7\u10ee\u10dd\u10d5\u10e1, \u10d7\u10e5\u10d5\u10d4\u10dc \u10db\u10d8\u10e1\u10ea\u10d4\u10db\u10d7 \u10d9\u10d0\u10db\u10d4\u10e0\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e7\u10d4\u10dc\u10d4\u10d1\u10d8\u10e1 \u10dc\u10d4\u10d1\u10d0\u10e0\u10d7\u10d5\u10d0\u10e1.",
