    "Earned %(created)s.": "\u10db\u10d8\u10e6\u10d4\u10d1\u10e3\u10da\u10d8 %(created)s.",
    "EdX doesn't have a timed transcript for this video in Studio, but we found a transcript on YouTube. You can import the YouTube transcript or upload your own .srt transcript file.": "EdX-\u10e1 \u10d0\u10e0 \u10d0\u10e5\u10d5\u10e1 \u10e1\u10e2\u10e3\u10d3\u10d8\u10dd\u10e8\u10d8 \u10d0\u10db \u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 \u10e1\u10d8\u10dc\u10e5\u10e0\u10dd\u10dc\u10d8\u10d6\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8, \u10db\u10d0\u10d2\u10e0\u10d0\u10db \u10e9\u10d5\u10d4\u10dc \u10d8\u10e1 YouTube-\u10d6\u10d4 \u10d5\u10d8\u10de\u10dd\u10d5\u10dc\u10d4\u10d7. \u10d7\u10e5\u10d5\u10d4\u10dc \u10e8\u10d4\u10d2\u10d8\u10eb\u10da\u10d8\u10d0\u10d7 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 YouTube-\u10d3\u10d0\u10dc \u10e8\u10d4\u10db\u10dd\u10e2\u10d0\u10dc\u10d0, \u10d0\u10dc \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 .srt \u10e4\u10d0\u10d8\u10da\u10d8\u10e1 \u10ee\u10d4\u10da\u10d8\u10d7 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0.",
    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "EdX-\u10e1 \u10d0\u10db \u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 \u10e1\u10d8\u10dc\u10e5\u10e0\u10dd\u10dc\u10d8\u10d6\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8 \u10d0\u10e0 \u10d0\u10e5\u10d5\u10e1. \u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10dd\u10d7 .srt \u10e4\u10d0\u10d8\u10da\u10d8.",
    "EdX has a timed transcript for this video. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript. If you want to replace this transcript, upload a new .srt transcript file.": "EdX-\u10e1 \u10d0\u10e5\u10d5\u10e1 \u10d0\u10db \u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 \u10e1\u10d8\u10dc\u10e5\u10e0\u10dd\u10dc\u10d8\u10d6\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10e4\u10d0\u10d8\u10da\u10d8. \u10d7\u10e3 \u10db\u10d8\u10e1\u10d8 \u10e0\u10d4\u10d3\u10d0\u10e5\u10e2\u10d8\u10e0\u10d4\u10d1\u10d0 \u10d2\u10e1\u10e3\u10e0\u10d7, \u10db\u10d0\u10e8\u10d8\u10dc \u10e3\u10dc\u10d3\u10d0 \u10e9\u10d0\u10db\u10dd\u10e2\u10d5\u10d8\u10e0\u10d7\u10dd\u10d7, \u10e8\u10d4\u10d0\u10e1\u10ec\u10dd\u10e0\u10dd\u10d7 \u10d3\u10d0 \u10ee\u10d4\u10da\u10d0\u10ee\u10da\u10d0 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10dd\u10d7 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8. \u10d7\u10e3 \u10d7\u10e5\u10d5\u10d4\u10dc \u10db\u10d8\u10e1\u10d8 \u10e9\u10d0\u10dc\u10d0\u10ea\u10d5\u10da\u10d4\u10d1\u10d0 \u10d2\u10e1\u10e3\u10e0\u10d7, \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10d0\u10ee\u10d0\u10da\u10d8 .srt \u10e4\u10d0\u10d8\u10da\u10d8.",
    "EdX has a timed transcript for this video. If you want to replace this transcript, upload a new .srt transcript file. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript.": "EdX-\u10e1 \u10d0\u10e5\u10d5\u10e1 \u10d0\u10db \u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 \u10e1\u10d8\u10dc\u10e5\u10e0\u10dd\u10dc\u10d8\u10d6\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8. \u10d7\u10e3 \u10d2\u10e1\u10e3\u10e0\u10d7 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10e9\u10d0\u10dc\u10d0\u10ea\u10d5\u10da\u10d4\u10d1\u10d0, \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d0\u10ee\u10d0\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 .srt \u10e4\u10d0\u10d8\u10da\u10d8. \u10d7\u10e3 \u10d2\u10e1\u10e3\u10e0\u10d7 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8\u10e1 \u10e0\u10d4\u10d3\u10d0\u10e5\u10e2\u10d8\u10e0\u10d4\u10d1\u10d0, \u10db\u10d0\u10e8\u10d8\u10dc \u10e9\u10d0\u10db\u10dd\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7, \u10e8\u10d4\u10ea\u10d5\u10d0\u10da\u10d4\u10d7 \u10d3\u10d0 \u10ee\u10d4\u10da\u10d0\u10ee\u10da\u10d0 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8.",
    "Edit %(display_name)s (required)": "%(display_name)s \u10e0\u10d4\u10d3\u10d0\u10e5\u10e2\u10d8\u10e0\u10d4\u10d1\u10d0 (\u10e1\u10d0\u10d5\u10d0\u10da\u10d3\u10d4\u10d1\u10e3\u10da\u10dd)",
