    "Group B": "\u10ef\u10d2\u10e3\u10e4\u10d8 B",
    "Group Configuration ID": "\u10ef\u10d2\u10e3\u10e4\u10d8\u10e1 \u10d9\u10dd\u10dc\u10e4\u10d8\u10d2\u10e3\u10e0\u10d0\u10ea\u10d8\u10d8\u10e1 ID",
    "Group Configuration Name": "\u10ef\u10d2\u10e3\u10e4\u10d8\u10e1 \u10d9\u10dd\u10dc\u10e4\u10d8\u10d2\u10e3\u10e0\u10d0\u10ea\u10d8\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8",
    "Group Configuration information": "\u10ef\u10d2\u10e3\u10e4\u10d8\u10e1 \u10d9\u10dd\u10dc\u10e4\u10d8\u10d2\u10e3\u10e0\u10d0\u10ea\u10d8\u10d8\u10e1 \u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d0",
