    "Group information": "\u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d0 \u10ef\u10d2\u10e3\u10e4\u10d8\u10e1 \u10e8\u10d4\u10e1\u10d0\u10ee\u10d4\u10d1",
    "Group name is required": "\u10ef\u10d2\u10e3\u10e4\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8\u10e1 \u10db\u10d8\u10d7\u10d8\u10d7\u10d4\u10d1\u10d0 \u10e1\u10d0\u10d5\u10d0\u10da\u10d3\u10d4\u10d1\u10e3\u10da\u10dd\u10d0",
    "Groups": "\u10ef\u10d2\u10e3\u10e4\u10d4\u10d1\u10d8",
    "Heading": "\u10e1\u10d0\u10d7\u10d0\u10e3\u10e0\u10d8",
    "Heading (Ctrl+H)": "\u10e1\u10d0\u10d7\u10d0\u10e3\u10e0\u10d8 (Ctrl+H)",
    "Help other learners decide whether to join your team by specifying some characteristics for your team. Choose carefully, because fewer people might be interested in joining your team if it seems too restrictive.": "\u10d2\u10d0\u10e3\u10e6\u10d5\u10d8\u10d5\u10d4\u10d7 \u10d7\u10d0\u10dc\u10d0\u10d9\u10e3\u10e0\u10e1\u10d4\u10da\u10d4\u10d1\u10e1 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10d2\u10e3\u10dc\u10d3\u10e8\u10d8 \u10d2\u10d0\u10d4\u10e0\u10d7\u10d8\u10d0\u10dc\u10d4\u10d1\u10d8\u10e1 \u10e1\u10e3\u10e0\u10d5\u10da\u10d8 \u10d3\u10d0 \u10db\u10d8\u10e3\u10d7\u10d8\u10d7\u10d4\u10d7 \u10d2\u10e3\u10dc\u10d3\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10d7\u10d8 \u10db\u10d0\u10ee\u10d0\u10e1\u10d8\u10d0\u10d7\u10d4\u10d1\u10da\u10d4\u10d1\u10d8. \u10d8\u10e7\u10d0\u10d5\u10d8\u10d7 \u10e4\u10e0\u10d7\u10ee\u10d8\u10da\u10d0\u10d3, \u10e0\u10d0\u10d3\u10d2\u10d0\u10dc \u10d6\u10d4\u10d3\u10db\u10d4\u10e2\u10db\u10d0 \u10e8\u10d4\u10d6\u10e6\u10e3\u10d3\u10d5\u10d4\u10d1\u10db\u10d0, \u10e8\u10d4\u10d8\u10eb\u10da\u10d4\u10d1\u10d0 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10d2\u10e3\u10dc\u10d3\u10e8\u10d8 \u10d2\u10d0\u10ec\u10d4\u10d5\u10e0\u10d8\u10d0\u10dc\u10d4\u10d1\u10d8\u10e1 \u10db\u10e1\u10e3\u10e0\u10d5\u10d4\u10da\u10d7\u10d0 \u10e0\u10d8\u10ea\u10ee\u10d5\u10d8 \u10e8\u10d4\u10d0\u10db\u10ea\u10d8\u10e0\u10dd\u10e1.",
    "Hide": "\u10d3\u10d0\u10d5\u10db\u10d0\u10da\u10dd\u10d7",
    "Hide Deprecated Settings": "\u10db\u10dd\u10eb\u10d5\u10d4\u10da\u10d4\u10d1\u10e3\u10da\u10d8 \u10de\u10d0\u10e0\u10d0\u10db\u10d4\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10da\u10d5\u10d0",
