    "Hide content after due date": "\u10e8\u10d8\u10d2\u10d7\u10d0\u10d5\u10e1\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10da\u10d5\u10d0 \u10db\u10d8\u10d7\u10d8\u10d7\u10d4\u10d1\u10e3\u10da\u10d8 \u10d7\u10d0\u10e0\u10d8\u10e6\u10d8\u10e1 \u10e8\u10d4\u10db\u10d3\u10d4\u10d2",
