    "Hide from learners": "\u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d7\u10d0\u10d7\u10d5\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10da\u10d5\u10d0",
