    "Learn more about {license_name}": "\u10e8\u10d4\u10d8\u10e2\u10e7\u10d5\u10d4\u10d7 \u10db\u10d4\u10e2\u10d8 {license_name}-\u10d8\u10e1 \u10e8\u10d4\u10e1\u10d0\u10ee\u10d4\u10d1",
    "Learners are added to this cohort automatically.": "\u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8\u10e1 \u10d0\u10db \u10ef\u10d2\u10e3\u10e4\u10e8\u10d8 \u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d0 \u10d0\u10d5\u10e2\u10dd\u10db\u10d0\u10e2\u10e3\u10e0\u10d0\u10d3 \u10ee\u10d3\u10d4\u10d1\u10d0.",
    "Learners are added to this cohort only when you provide their email addresses or usernames on this page.": "\u10d0\u10db \u10ef\u10d2\u10e3\u10e4\u10e8\u10d8 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d7\u10d0 \u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d0 \u10ee\u10d3\u10d4\u10d1\u10d0, \u10db\u10ee\u10dd\u10da\u10dd\u10d3 \u10d7\u10e5\u10d5\u10d4\u10dc \u10db\u10d8\u10d4\u10e0 \u10d0\u10db \u10d2\u10d5\u10d4\u10e0\u10d3\u10d6\u10d4 \u10db\u10d0\u10d7\u10d8 \u10db\u10dd\u10db\u10ee\u10db\u10d0\u10e0\u10d4\u10d1\u10da\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8\u10e1, \u10d0\u10dc \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10e1 \u10e8\u10d4\u10db\u10d3\u10d4\u10d2.",
    "Learners do not see the subsection in the course outline. The subsection is not included in grade calculations.": "\u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8 \u10d5\u10d4\u10e0 \u10ee\u10d4\u10d3\u10d0\u10d5\u10d4\u10dc \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d0\u10e1 \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1 \u10e1\u10e2\u10e0\u10e3\u10e5\u10e2\u10e3\u10e0\u10d0\u10e8\u10d8. \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d0 \u10e1\u10d0\u10d1\u10dd\u10da\u10dd\u10dd \u10e8\u10d4\u10e4\u10d0\u10e1\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10d7\u10d5\u10da\u10d0\u10e8\u10d8 \u10d0\u10e0 \u10db\u10dd\u10dc\u10d0\u10ec\u10d8\u10da\u10d4\u10dd\u10d1\u10e1.",
    "Learners see the published subsection and can access its content.": "\u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8 \u10ee\u10d4\u10d3\u10d0\u10d5\u10d4\u10dc \u10d2\u10d0\u10db\u10dd\u10e5\u10d5\u10d4\u10e7\u10dc\u10d4\u10d1\u10e3\u10da \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d0\u10e1 \u10d3\u10d0 \u10e8\u10d4\u10e3\u10eb\u10da\u10d8\u10d0\u10d7 \u10db\u10d8\u10e1 \u10e8\u10d8\u10dc\u10d0\u10d0\u10e0\u10e1\u10d7\u10d0\u10dc \u10ec\u10d5\u10d3\u10dd\u10db\u10d0.",
    "Learners who require verification must pass the selected checkpoint to see the content in this unit. Learners who do not require verification see this content by default.": "\u10d8\u10db \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d4\u10d1\u10db\u10d0, \u10e0\u10dd\u10db\u10da\u10d4\u10d1\u10e1\u10d0\u10ea \u10de\u10d8\u10e0\u10dd\u10d5\u10dc\u10d4\u10d1\u10d8\u10e1 \u10d3\u10d0\u10d3\u10d0\u10e1\u10e2\u10e3\u10e0\u10d4\u10d1\u10d0 \u10e1\u10ed\u10d8\u10e0\u10d3\u10d4\u10d1\u10d0\u10d7, \u10db\u10dd\u10ea\u10d4\u10db\u10e3\u10da\u10d8 \u10d1\u10da\u10dd\u10d9\u10d8\u10e1 \u10e1\u10d0\u10dc\u10d0\u10ee\u10d0\u10d5\u10d0\u10d3 \u10e1\u10d0\u10d9\u10dd\u10dc\u10e2\u10e0\u10dd\u10da\u10dd \u10dc\u10d8\u10e8\u10dc\u10e3\u10da\u10d8 \u10e3\u10dc\u10d3\u10d0 \u10d2\u10d0\u10d8\u10d0\u10e0\u10dd\u10dc. \u10d8\u10e1 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8 \u10d9\u10d8, \u10d5\u10d8\u10e1\u10d0\u10ea \u10de\u10d8\u10e0\u10dd\u10d5\u10dc\u10d4\u10d1\u10d8\u10e1 \u10d3\u10d0\u10d3\u10d0\u10e1\u10e2\u10e3\u10e0\u10d4\u10d1\u10d0 \u10d0\u10e0 \u10e1\u10ed\u10d8\u10e0\u10d3\u10d4\u10d1\u10d0\u10d7 \u10d0\u10db \u10e8\u10d8\u10dc\u10d0\u10d0\u10e0\u10e1\u10d7\u10d0\u10dc \u10ec\u10d5\u10d3\u10dd\u10db\u10d0\u10e1 \u10d0\u10d5\u10e2\u10dd\u10db\u10d0\u10e2\u10e3\u10e0\u10d0\u10d3 \u10db\u10d8\u10d8\u10e6\u10d4\u10d1\u10d4\u10dc.",
