    "Links are generated on demand and expire within 5 minutes due to the sensitive nature of student information.": "\u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d8\u10e1 \u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d8\u10e1 \u10db\u10d2\u10e0\u10eb\u10dc\u10dd\u10d1\u10d8\u10d0\u10e0\u10d4 \u10d1\u10e3\u10dc\u10d4\u10d1\u10d8\u10d3\u10d0\u10dc \u10d2\u10d0\u10db\u10dd\u10db\u10d3\u10d8\u10dc\u10d0\u10e0\u10d4, \u10d1\u10db\u10e3\u10da\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d4\u10dc\u10d4\u10e0\u10d8\u10e0\u10d4\u10d1\u10d0 \u10ee\u10d3\u10d4\u10d1\u10d0 \u10db\u10dd\u10d7\u10ee\u10dd\u10d5\u10dc\u10d8\u10d7 \u10d3\u10d0 \u10d5\u10d0\u10d3\u10d0 5 \u10ec\u10e3\u10d7\u10e8\u10d8 \u10d4\u10ec\u10e3\u10e0\u10d4\u10d1\u10d0.  ",
