    "Please correct the outlined fields.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e9\u10d0\u10d0\u10e1\u10ec\u10dd\u10e0\u10dd\u10d7 \u10d0\u10db\u10dd\u10dc\u10d0\u10d7\u10d4\u10d1\u10e3\u10da\u10d8 \u10d5\u10d4\u10da\u10d4\u10d1\u10d8.",
    "Please describe this image or agree that it has no contextual value by checking the checkbox.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10d0\u10e6\u10ec\u10d4\u10e0\u10d4\u10d7 \u10d4\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0 \u10d0\u10dc \u10d3\u10d0\u10d4\u10d7\u10d0\u10dc\u10ee\u10db\u10d4\u10d7, \u10e0\u10dd\u10db \u10db\u10d0\u10e1 \u10d0\u10e0 \u10d0\u10e5\u10d5\u10e1 \u10d9\u10dd\u10dc\u10e2\u10d4\u10e5\u10e1\u10e2\u10e3\u10d0\u10da\u10e3\u10e0\u10d8 \u10db\u10dc\u10d8\u10e8\u10d5\u10dc\u10d4\u10da\u10dd\u10d1\u10d0, \u10db\u10dd\u10e1\u10d0\u10dc\u10d8\u10e8\u10dc\u10d8\u10e1 \u10db\u10dd\u10dc\u10d8\u10e8\u10d5\u10dc\u10d8\u10d7.",
    "Please do not use any spaces in this field.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10d0\u10db \u10d5\u10d4\u10da\u10e8\u10d8 \u10f0\u10d0\u10e0\u10d8 \u10d0\u10e0 \u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10dd\u10d7.",
    "Please do not use any spaces or special characters in this field.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10d0\u10db \u10d5\u10d4\u10da\u10e8\u10d8 \u10f0\u10d0\u10e0\u10d8 \u10d0\u10dc \u10e1\u10de\u10d4\u10ea\u10d8\u10da\u10e3\u10e0\u10d8 \u10e1\u10d8\u10db\u10d1\u10dd\u10da\u10dd\u10d4\u10d1\u10d8 \u10d0\u10e0 \u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10dd\u10d7.",
    "Please enter a problem location.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10d4\u10d7 \u10d0\u10db\u10dd\u10ea\u10d0\u10dc\u10d8\u10e1 \u10d0\u10d3\u10d2\u10d8\u10da\u10db\u10d3\u10d4\u10d1\u10d0\u10e0\u10d4\u10dd\u10d1\u10d0.",
    "Please enter a student email address or username.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d8\u10e1 \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d0 \u10d0\u10dc \u10db\u10dd\u10db\u10ee\u10db\u10d0\u10e0\u10d4\u10d1\u10da\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7.",
    "Please enter a term in the {anchorStart} search field{anchorEnd}.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10d4\u10d7 \u10d5\u10d0\u10d3\u10d0 {anchorStart} \u10e1\u10d0\u10eb\u10d8\u10d4\u10d1\u10dd \u10d5\u10d4\u10da\u10e8\u10d8{anchorEnd}.",
    "Please enter a username or email.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10db\u10dd\u10db\u10ee\u10db\u10d0\u10e0\u10d4\u10d1\u10da\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10d0\u10dc \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d0.",
    "Please enter a valid donation amount.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10d4\u10d7 \u10e8\u10d4\u10db\u10dd\u10ec\u10d8\u10e0\u10e3\u10da\u10dd\u10d1\u10d8\u10e1 \u10e1\u10ec\u10dd\u10e0\u10d8 \u10dd\u10d3\u10d4\u10dc\u10dd\u10d1\u10d0.",
    "Please enter an integer between %(min)s and %(max)s.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10db\u10d7\u10d4\u10da\u10d8 \u10e0\u10d8\u10ea\u10ee\u10d5\u10d8 %(min)s-\u10d3\u10d0\u10dc %(max)s-\u10db\u10d3\u10d4.",
    "Please enter an integer between 0 and 100.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10db\u10d7\u10d4\u10da\u10d8 \u10e0\u10d8\u10ea\u10ee\u10d5\u10d8 0-\u10d3\u10d0\u10dc 100-\u10db\u10d3\u10d4.",
    "Please enter an integer greater than 0.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10db\u10d7\u10d4\u10da\u10d8 \u10e0\u10d8\u10ea\u10ee\u10d5\u10d8, \u10e0\u10dd\u10db\u10d4\u10da\u10d8\u10ea \u10db\u10d4\u10e2\u10d8\u10d0 0-\u10d6\u10d4.",
    "Please enter non-negative integer.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10d3\u10d0\u10d3\u10d4\u10d1\u10d8\u10d7\u10d8 \u10db\u10d7\u10d4\u10da\u10d8 \u10e0\u10d8\u10ea\u10ee\u10d5\u10d8.",
    "Please enter valid start date and time.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10d3\u10d0\u10ec\u10e7\u10d4\u10d1\u10d8\u10e1 \u10d6\u10e3\u10e1\u10e2\u10d8 \u10d7\u10d0\u10e0\u10d8\u10e6\u10d8 \u10d3\u10d0 \u10d3\u10e0\u10dd.",
    "Please enter your %(field)s.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10e8\u10d4\u10d8\u10e7\u10d5\u10d0\u10dc\u10dd\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 %(field)s.",
    "Please follow the instructions here to upload a file elsewhere and link to it: {maxFileSizeRedirectUrl}": "\u10e4\u10d0\u10d8\u10da\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d8\u10e1\u10d0 \u10d3\u10d0 \u10db\u10d8\u10e1\u10d8 \u10d1\u10db\u10e3\u10da\u10d8\u10e1 \u10e9\u10d0\u10e1\u10db\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1 \u10db\u10d8\u10f0\u10e7\u10d4\u10d5\u10d8\u10d7 \u10d8\u10dc\u10e1\u10e2\u10e0\u10e3\u10e5\u10ea\u10d8\u10d4\u10d1\u10e1: {maxFileSizeRedirectUrl}",
    "Please print this page for your records; it serves as your receipt. You will also receive an email with the same information.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10d0\u10db\u10dd\u10d1\u10d4\u10ed\u10d3\u10dd\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10e9\u10d0\u10dc\u10d0\u10ec\u10d4\u10e0\u10d4\u10d1\u10d8\u10e1 \u10d4\u10e1 \u10d2\u10d5\u10d4\u10e0\u10d3\u10d8. \u10d8\u10e1 \u10d0\u10e1\u10e0\u10e3\u10da\u10d4\u10d1\u10e1 \u10e5\u10d5\u10d8\u10d7\u10e0\u10d8\u10e1 \u10e4\u10e3\u10dc\u10e5\u10ea\u10d8\u10d0\u10e1. \u10d7\u10e5\u10d5\u10d4\u10dc \u10d0\u10e1\u10d4\u10d5\u10d4 \u10db\u10d8\u10d8\u10e6\u10d4\u10d1\u10d7 \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d8\u10e1 \u10e8\u10d4\u10e2\u10e7\u10dd\u10d1\u10d8\u10dc\u10d4\u10d1\u10d0\u10e1 \u10d8\u10d2\u10d8\u10d5\u10d4 \u10d8\u10dc\u10e4\u10dd\u10e0\u10db\u10d0\u10ea\u10d8\u10d8\u10d7.",
    "Please provide a description of the link destination.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10db\u10dd\u10d2\u10d5\u10d0\u10ec\u10dd\u10d3\u10dd\u10d7 \u10d1\u10db\u10e3\u10da\u10d8\u10e1 \u10d0\u10e6\u10ec\u10d4\u10e0\u10d0.",
    "Please provide a valid URL.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10db\u10dd\u10d2\u10d5\u10d0\u10ec\u10dd\u10d3\u10dd\u10d7 \u10db\u10dd\u10e5\u10db\u10d4\u10d3\u10d8 URL.",
    "Please specify a reason.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10d3\u10d0\u10d0\u10d9\u10dd\u10dc\u10d9\u10e0\u10d4\u10e2\u10d4\u10d7 \u10db\u10d8\u10d6\u10d4\u10d6\u10d8.",
    "Please verify that you have uploaded a valid image (PNG and JPEG).": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7 \u10e8\u10d4\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d7, \u10e0\u10dd\u10db \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10e3\u10da\u10d8\u10d0 \u10e8\u10d4\u10e1\u10d0\u10d1\u10d0\u10db\u10d8\u10e1\u10d8 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0 (PNG \u10d3\u10d0 JPEG).",
    "Please verify that your webcam is connected and that you have allowed your browser to access it.": "\u10d2\u10d7\u10ee\u10dd\u10d5\u10d7, \u10d3\u10d0\u10d0\u10d3\u10d0\u10e1\u10e2\u10e3\u10e0\u10d4\u10d7, \u10e0\u10dd\u10db \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d5\u10d4\u10d1\u10d9\u10d0\u10db\u10d4\u10e0\u10d0 \u10e8\u10d4\u10d4\u10e0\u10d7\u10d4\u10d1\u10e3\u10da\u10d8\u10d0 \u10d3\u10d0 \u10d7\u10e5\u10d5\u10d4\u10dc \u10e8\u10d4\u10e1\u10d0\u10eb\u10da\u10d4\u10d1\u10da\u10dd\u10d1\u10d0 \u10db\u10d8\u10d4\u10ea\u10d8\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10e1 \u10d1\u10e0\u10d0\u10e3\u10d6\u10d4\u10e0\u10e1 \u10f0\u10e5\u10dd\u10dc\u10d3\u10d4\u10e1 \u10db\u10d0\u10e1\u10d7\u10d0\u10dc \u10ec\u10d5\u10d3\u10dd\u10db\u10d0.",
    "Post": "\u10de\u10dd\u10e1\u10e2\u10d8",
