    "Practice proctored Exam": "\u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d8\u10e1 \u10de\u10e0\u10d0\u10e5\u10e2\u10d8\u10d9\u10d8\u10e1 \u10d2\u10d0\u10d5\u10da\u10d0",
