    "Prevent students from generating certificates in this course?": "\u10d0\u10e0 \u10db\u10d8\u10d4\u10ea\u10d4\u10d7 \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d4\u10d1\u10e1 \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d4\u10dc\u10d4\u10e0\u10d8\u10e0\u10d4\u10d1\u10d8\u10e1 \u10e1\u10d0\u10e8\u10e3\u10d0\u10da\u10d4\u10d1\u10d0 \u10d0\u10db \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1?",
    "Preview": "\u10d2\u10d0\u10d3\u10d0\u10ee\u10d4\u10d3\u10d5\u10d0",
    "Preview Certificate": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10d2\u10d0\u10d3\u10d0\u10ee\u10d4\u10d3\u10d5\u10d0",
    "Preview of uploaded image": "\u10d2\u10d0\u10d3\u10d0\u10ee\u10d4\u10d3\u10d4\u10d7 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10e3\u10da \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0\u10e1",
    "Preview this query": "\u10d2\u10d0\u10d3\u10d0\u10ee\u10d4\u10d3\u10d4\u10d7 \u10d0\u10db \u10db\u10dd\u10d7\u10ee\u10dd\u10d5\u10dc\u10d0\u10e1",
    "Previous": "\u10ec\u10d8\u10dc\u10d0",
    "Previous Uploads": "\u10ec\u10d8\u10dc\u10d0 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d4\u10d1\u10d8",
    "Previous Uploads table has been updated.": "\u10ec\u10d8\u10dc\u10d0 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d4\u10d1\u10d8\u10e1 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10ea\u10ee\u10e0\u10d8\u10da\u10d8 \u10d2\u10d0\u10dc\u10d0\u10ee\u10da\u10d3\u10d0.",
    "Previously published": "\u10d0\u10d3\u10e0\u10d4 \u10d2\u10d0\u10db\u10dd\u10e5\u10d5\u10d4\u10e7\u10dc\u10d4\u10d1\u10e3\u10da\u10d8",
