    "Proctored": "\u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8",
    "Proctored Exam": "\u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d0 \u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8",
    "Proctored exams are timed and they record video of each learner taking the exam. The videos are then reviewed to ensure that learners follow all examination rules.": "\u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d4\u10d1\u10d8 \u10d3\u10e0\u10dd\u10e8\u10d8 \u10e8\u10d4\u10d6\u10e6\u10e3\u10d3\u10e3\u10da\u10d8\u10d0 \u10d3\u10d0 \u10db\u10d8\u10e1 \u10d2\u10d0\u10dc\u10db\u10d0\u10d5\u10da\u10dd\u10d1\u10d0\u10e8\u10d8 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ea\u10d3\u10d4\u10da\u10d6\u10d4 \u10d5\u10d8\u10d3\u10d4\u10dd \u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d0 \u10db\u10d8\u10db\u10d3\u10d8\u10dc\u10d0\u10e0\u10d4\u10dd\u10d1\u10e1. \u10e8\u10d4\u10db\u10d3\u10d4\u10d2 \u10d4\u10e1 \u10d5\u10d8\u10d3\u10d4\u10dd\u10e9\u10d0\u10dc\u10d0\u10ec\u10d4\u10e0\u10d4\u10d1\u10d8 \u10d2\u10d0\u10d3\u10d0\u10db\u10dd\u10ec\u10db\u10d3\u10d4\u10d1\u10d0, \u10e0\u10dd\u10db \u10d3\u10d0\u10d5\u10e0\u10ec\u10db\u10e3\u10dc\u10d3\u10d4\u10d7, \u10e0\u10dd\u10db \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d8\u10e1 \u10ec\u10d4\u10e1\u10d4\u10d1\u10d8 \u10d0\u10e0 \u10d3\u10d0\u10e0\u10e6\u10d5\u10d4\u10e3\u10da\u10d0.",
