    "Sorry, no results were found.": "\u10e1\u10d0\u10db\u10ec\u10e3\u10ee\u10d0\u10e0\u10dd\u10d3 \u10eb\u10d8\u10d4\u10d1\u10d0 \u10e3\u10e8\u10d4\u10d3\u10d4\u10d2\u10dd\u10d3 \u10d3\u10d0\u10e1\u10e0\u10e3\u10da\u10d3\u10d0.",
    "Sorted by": "\u10d3\u10d0\u10ee\u10d0\u10e0\u10d8\u10e1\u10ee\u10d4\u10d1\u10e3\u10da\u10d8\u10d0",
    "Specify an alternative to the official course title to display on certificates. Leave blank to use the official course title.": "\u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d6\u10d4 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10e2\u10d0\u10dc\u10d0\u10d3, \u10db\u10d8\u10e3\u10d7\u10d8\u10d7\u10d4\u10d7 \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1 \u10dd\u10e4\u10d8\u10ea\u10d8\u10d0\u10da\u10e3\u10e0\u10d8 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8\u10e1 \u10d0\u10da\u10e2\u10d4\u10e0\u10dc\u10d0\u10e2\u10d8\u10e3\u10da\u10d8 \u10d5\u10d4\u10e0\u10e1\u10d8\u10d0. \u10dd\u10e4\u10d8\u10ea\u10d8\u10d0\u10da\u10e3\u10e0\u10d8 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10e7\u10d4\u10dc\u10d4\u10d1\u10da\u10d0\u10d3, \u10d3\u10d0\u10e2\u10dd\u10d5\u10d4\u10d7 \u10ea\u10d0\u10e0\u10d8\u10d4\u10da\u10d8.",
