    "Staff and Learners": "\u10d7\u10d0\u10dc\u10d0\u10db\u10e8\u10e0\u10dd\u10db\u10da\u10d4\u10d1\u10d8\u10e1\u10d0 \u10d3\u10d0 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d7\u10d0\u10d7\u10d5\u10d8\u10e1",
