    "Start generating certificates for all students in this course?": "\u10d3\u10d0\u10d8\u10ec\u10e7\u10dd\u10e1 \u10e7\u10d5\u10d4\u10da\u10d0 \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1 \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d4\u10dc\u10d4\u10e0\u10d8\u10e0\u10d4\u10d1\u10d0 \u10d0\u10db \u10d9\u10e3\u10e0\u10e1\u10d6\u10d4?",
