    "Started rescore problem task for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "\u10d0\u10db\u10dd\u10ea\u10d0\u10dc\u10d8\u10e1 \u10ee\u10d4\u10da\u10d0\u10ee\u10da\u10d0 \u10e8\u10d4\u10e4\u10d0\u10e1\u10d4\u10d1\u10d8\u10e1 \u10d3\u10d0\u10d5\u10d0\u10da\u10d4\u10d1\u10d0 \u10d0\u10db\u10dd\u10ea\u10d0\u10dc\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1 '<%- problem_id %>' \u10d3\u10d0 \u10e1\u10e2\u10e3\u10d3\u10d4\u10dc\u10e2\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1 '<%- student_id %>' \u10d3\u10d0\u10d8\u10ec\u10e7\u10dd. \u10d3\u10d0\u10d5\u10d0\u10da\u10d4\u10d1\u10d8\u10e1 \u10e1\u10e2\u10d0\u10e2\u10e3\u10e1\u10d8\u10e1 \u10e1\u10d0\u10dc\u10d0\u10ee\u10d0\u10d5\u10d0\u10d3 \u10d3\u10d0\u10d0\u10ec\u10d9\u10d0\u10de\u10e3\u10dc\u10d4\u10d7 \u10e6\u10d8\u10da\u10d0\u10d9\u10e1 \"\u10d3\u10d0\u10d5\u10d0\u10da\u10d4\u10d1\u10d8\u10e1 \u10e1\u10e2\u10d0\u10e2\u10e3\u10e1\u10d8\u10e1 \u10dc\u10d0\u10ee\u10d5\u10d0\".",
