    "Upgrade to a Verified Certificate for {courseName}": "{courseName}-\u10d6\u10d4 \u10e9\u10d0\u10e0\u10d8\u10ea\u10ee\u10d5\u10d8\u10e1 \u10e1\u10e2\u10d0\u10e2\u10e3\u10e1\u10d8\u10e1 \u10d0\u10db\u10d0\u10e6\u10da\u10d4\u10d1\u10d0 \u10d3\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d1\u10e3\u10da \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d0\u10db\u10d3\u10d4",
    "Upload": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0",
