    "Upload New File": "\u10d0\u10ee\u10d0\u10da\u10d8 \u10e4\u10d0\u10d8\u10da\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0",
    "Upload New Transcript": "\u10d0\u10ee\u10d0\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0",
