    "Upload a CSV file": "CSV \u10e4\u10d0\u10d8\u10da\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0",
    "Upload a comma separated values (.csv) file that contains the usernames or email addresses of learners who have been given exceptions. Include the username or email address in the first comma separated field. You can include an optional note describing the reason for the exception in the second comma separated field.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 (.csv) \u10db\u10eb\u10d8\u10db\u10d8\u10d7 \u10d2\u10d0\u10db\u10dd\u10e7\u10dd\u10e4\u10d8\u10da\u10d8 \u10db\u10dc\u10d8\u10e8\u10d5\u10dc\u10d4\u10da\u10dd\u10d1\u10d4\u10d1\u10d8\u10e1 \u10e4\u10d0\u10d8\u10da\u10d8, \u10e0\u10dd\u10db\u10da\u10d4\u10d1\u10d8\u10ea \u10e8\u10d4\u10d8\u10ea\u10d0\u10d5\u10e1 \u10d8\u10db \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8\u10e1 \u10db\u10dd\u10db\u10ee\u10db\u10d0\u10e0\u10d4\u10d1\u10da\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10e1, \u10d0\u10dc \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d8\u10e1 \u10db\u10d8\u10e1\u10d0\u10db\u10d0\u10e0\u10d7\u10e1, \u10e0\u10dd\u10db\u10da\u10d4\u10d1\u10d8\u10ea \u10d2\u10d0\u10db\u10dd\u10dc\u10d0\u10d9\u10da\u10d8\u10d4\u10d1\u10e8\u10d8 \u10db\u10dd\u10ee\u10d5\u10d3\u10dc\u10d4\u10dc. \u10db\u10dd\u10db\u10ee\u10d0\u10e0\u10d4\u10d1\u10da\u10d8\u10e1 \u10e1\u10d0\u10ee\u10d4\u10da\u10d8 \u10d3\u10d0 \u10d4\u10da\u10e4\u10dd\u10e1\u10e2\u10d8\u10e1 \u10db\u10d8\u10e1\u10d0\u10db\u10d0\u10e0\u10d7\u10d8 \u10e8\u10d4\u10d8\u10e2\u10d0\u10dc\u10d4\u10d7 \u10de\u10d8\u10e0\u10d5\u10d4\u10da \u10db\u10eb\u10d8\u10db\u10d8\u10d7 \u10d2\u10d0\u10db\u10dd\u10e7\u10dd\u10e4\u10d8\u10da \u10d5\u10d4\u10da\u10e8\u10d8. \u10db\u10eb\u10d8\u10db\u10d8\u10d7 \u10d2\u10d0\u10db\u10dd\u10e7\u10dd\u10e4\u10d8\u10da \u10db\u10d4\u10dd\u10e0\u10d4 \u10d5\u10d4\u10da\u10e8\u10d8 \u10e8\u10d4\u10d2\u10d8\u10eb\u10da\u10d8\u10d0\u10d7 \u10e8\u10d4\u10d8\u10e2\u10d0\u10dc\u10dd\u10d7 \u10dc\u10d4\u10d1\u10d0\u10e7\u10dd\u10e4\u10da\u10dd\u10d1\u10d8\u10d7\u10d8 \u10e8\u10d4\u10dc\u10d8\u10e8\u10d5\u10dc\u10d0\u10ea, \u10e0\u10dd\u10db\u10d4\u10da\u10d8\u10ea \u10d2\u10d0\u10db\u10dd\u10dc\u10d0\u10d9\u10da\u10d8\u10e1\u10d4\u10d1\u10e8\u10d8 \u10db\u10dd\u10ee\u10d5\u10d4\u10d3\u10e0\u10d8\u10e1 \u10db\u10d8\u10d6\u10d4\u10d6\u10e1 \u10d0\u10e6\u10ec\u10d4\u10e0\u10e1.",
