    "Upload an image or capture one with your web or phone camera.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10e1\u10e3\u10e0\u10d0\u10d7\u10d8 \u10d0\u10dc \u10d2\u10d0\u10d3\u10d0\u10d8\u10e6\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d5\u10d4\u10d1\u10d9\u10d0\u10db\u10d4\u10e0\u10d8\u10d7, \u10d0\u10dc \u10e2\u10d4\u10da\u10d4\u10e4\u10dd\u10dc\u10d8\u10e1 \u10d9\u10d0\u10db\u10d4\u10e0\u10d8\u10d7.",
    "Upload completed": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0 \u10d3\u10d0\u10e1\u10e0\u10e3\u10da\u10d4\u10d1\u10e3\u10da\u10d8\u10d0",
    "Upload failed": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0 \u10d5\u10d4\u10e0 \u10db\u10dd\u10ee\u10d4\u10e0\u10ee\u10d3\u10d0",
    "Upload instructor image.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d8\u10dc\u10e1\u10e2\u10e0\u10e3\u10e5\u10e2\u10dd\u10e0\u10d8\u10e1 \u10e1\u10e3\u10e0\u10d0\u10d7\u10d8.",
    "Upload is in progress. To avoid errors, stay on this page until the process is complete.": "\u10db\u10d8\u10db\u10d3\u10d8\u10dc\u10d0\u10e0\u10d4\u10dd\u10d1\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0. \u10e8\u10d4\u10ea\u10d3\u10dd\u10db\u10d4\u10d1\u10d8\u10e1 \u10d0\u10e1\u10d0\u10e0\u10d8\u10d3\u10d4\u10d1\u10da\u10d0\u10d3, \u10de\u10e0\u10dd\u10ea\u10d4\u10e1\u10d8 \u10d3\u10d0\u10e1\u10e0\u10e3\u10da\u10d4\u10d1\u10d0\u10db\u10d3\u10d4 \u10d3\u10d0\u10e0\u10e9\u10d8\u10d7 \u10d0\u10db \u10d2\u10d5\u10d4\u10e0\u10d3\u10d6\u10d4.",
    "Upload signature image.": "\u10ee\u10d4\u10da\u10db\u10dd\u10ec\u10d4\u10e0\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d8\u10e1 \u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0.",
    "Upload your banner image.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d1\u10d0\u10dc\u10d4\u10e0\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0.",
    "Upload your course image.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0.",
    "Upload your first asset": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10de\u10d8\u10e0\u10d5\u10d4\u10da\u10d8 \u10e0\u10d4\u10e1\u10e3\u10e0\u10e1\u10d8",
    "Upload your video thumbnail image.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 \u10d2\u10d0\u10db\u10dd\u10e1\u10d0\u10ee\u10e3\u10da\u10d4\u10d1\u10d0.",
    "Uploaded file issues. Click on \"+\" to view.": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10e3\u10da\u10d8 \u10e4\u10d0\u10d8\u10da\u10d4\u10d1\u10d8\u10e1 \u10e1\u10d0\u10d9\u10d8\u10d7\u10ee\u10d4\u10d1\u10d8. \u10e1\u10d0\u10dc\u10d0\u10ee\u10d0\u10d5\u10d0\u10d3 \u10d3\u10d0\u10d0\u10ec\u10d9\u10d0\u10de\u10e3\u10dc\u10d4\u10d7 \"+\" -\u10d6\u10d4.",
    "Uploading": "\u10d0\u10e2\u10d5\u10d8\u10e0\u10d7\u10d5\u10d0",
    "Upset Learner": "\u10d8\u10db\u10d4\u10d3\u10d2\u10d0\u10ea\u10e0\u10e3\u10d4\u10d1\u10e3\u10da\u10d8 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d8",
    "Use Current Transcript": "\u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e3\u10d1\u10e2\u10d8\u10e2\u10e0\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e7\u10d4\u10dc\u10d4\u10d1\u10d0",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "\u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10d4\u10d7 \u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d8\u10e1 \u10e1\u10d8\u10db\u10e3\u10da\u10d0\u10ea\u10d8\u10d0, \u10e0\u10dd\u10db \u10d2\u10d0\u10d0\u10ea\u10dc\u10dd\u10d7 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10e1 \u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10de\u10e0\u10dd\u10ea\u10d4\u10e1\u10d8 \u10d3\u10d0 \u10d8\u10dc\u10e1\u10e2\u10e0\u10e3\u10db\u10d4\u10dc\u10e2\u10d4\u10d1\u10d8. \u10d3\u10d0\u10d9\u10d5\u10d8\u10e0\u10d5\u10d4\u10d1\u10d8\u10e1 \u10e5\u10d5\u10d4\u10e8 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d8\u10e1 \u10e1\u10d0\u10ea\u10d3\u10d4\u10da \u10e0\u10d4\u10df\u10d8\u10db\u10e8\u10d8 \u10d2\u10d0\u10e8\u10d5\u10d4\u10d1\u10d0 \u10d0\u10e0 \u10d0\u10ee\u10d3\u10d4\u10dc\u10e1 \u10d2\u10d0\u10d5\u10da\u10d4\u10dc\u10d0\u10e1 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d7\u10d0 \u10e8\u10d4\u10e4\u10d0\u10e1\u10d4\u10d1\u10d0\u10d6\u10d4.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u10d3\u10d0\u10d0\u10ec\u10d4\u10e1\u10d4\u10d7 \u10d2\u10d0\u10db\u10dd\u10ea\u10d3\u10d4\u10d1\u10d8\u10e1 \u10ee\u10d0\u10dc\u10d2\u10e0\u10eb\u10da\u10d5\u10dd\u10d1\u10d0, \u10e0\u10dd\u10db \u10e8\u10d4\u10d6\u10e6\u10e3\u10d3\u10dd\u10d7 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8\u10e1 \u10db\u10d8\u10d4\u10e0 \u10e5\u10d5\u10d4\u10d2\u10d0\u10dc\u10e7\u10dd\u10e4\u10d8\u10da\u10d4\u10d1\u10d8\u10e1 \u10d0\u10db\u10dd\u10ea\u10d0\u10dc\u10d4\u10d1\u10d8\u10e1 \u10d2\u10d0\u10d3\u10d0\u10e1\u10d0\u10ec\u10e7\u10d5\u10d4\u10e2\u10d0\u10d3 \u10d3\u10d0\u10ee\u10d0\u10e0\u10ef\u10e3\u10da\u10d8 \u10d3\u10e0\u10dd. \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10db\u10d0 \u10e3\u10dc\u10d3\u10d0 \u10d2\u10d0\u10d2\u10d6\u10d0\u10d5\u10dc\u10dd\u10dc \u10de\u10d0\u10e1\u10e3\u10ee\u10d4\u10d1\u10d8 \u10d3\u10e0\u10dd\u10d8\u10e1 \u10d0\u10db\u10dd\u10ec\u10e3\u10e0\u10d5\u10d0\u10db\u10d3\u10d4. \u10db\u10d0\u10e0\u10d7\u10d5\u10d8\u10e1 \u10d3\u10d0\u10e4\u10d8\u10d3\u10d0\u10dc \u10ea\u10d0\u10da\u10d9\u10d4\u10e3\u10da\u10d8 \u10db\u10e1\u10db\u10d4\u10dc\u10d4\u10da\u10d4\u10d1\u10d8\u10e1\u10d7\u10d5\u10d8\u10e1 \u10d3\u10d0\u10db\u10d0\u10e2\u10d4\u10d1\u10d8\u10d7\u10d8 \u10d3\u10e0\u10dd\u10d8\u10e1 \u10d2\u10d0\u10db\u10dd\u10e7\u10dd\u10e4\u10d0 \u10e8\u10d4\u10d2\u10d8\u10eb\u10da\u10d8\u10d0\u10d7.",
    "Use as a Prerequisite": "\u10e1\u10d0\u10d5\u10d0\u10da\u10d3\u10d4\u10d1\u10e3\u10da\u10dd \u10de\u10d8\u10e0\u10dd\u10d1\u10d0\u10d3 \u10d2\u10d0\u10db\u10dd\u10e7\u10d4\u10dc\u10d4\u10d1\u10d0",
    "Use my institution/campus credentials": "\u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10d4\u10d7 \u10e9\u10d4\u10db\u10d8 \u10d8\u10dc\u10e1\u10e2\u10d8\u10e2\u10e3\u10e2\u10d8\u10e1/\u10d9\u10d0\u10db\u10de\u10e3\u10e1\u10d8\u10e1 \u10db\u10dd\u10d0\u10dc\u10d0\u10ea\u10d4\u10db\u10d4\u10d1\u10d8",
    "Use the All Topics menu to find specific topics.": "\u10d9\u10dd\u10dc\u10d9\u10e0\u10d4\u10e2\u10e3\u10da\u10d8 \u10d7\u10d4\u10db\u10d8\u10e1 \u10db\u10dd\u10e1\u10d0\u10eb\u10d8\u10d4\u10d1\u10da\u10d0\u10d3, \u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10d4\u10d7 \u10db\u10d4\u10dc\u10d8\u10e3 \u201e\u10e7\u10d5\u10d4\u10da\u10d0 \u10d7\u10d4\u10db\u10d0\u201c.",
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u10e4\u10dd\u10e2\u10dd \u10de\u10dd\u10e0\u10e2\u10e0\u10d4\u10e2\u10d8\u10e1 \u10d2\u10d0\u10d3\u10d0\u10e1\u10d0\u10e6\u10d4\u10d1\u10d0\u10d3 \u10d2\u10d0\u10db\u10dd\u10d8\u10e7\u10d4\u10dc\u10d4\u10d7 \u10d7\u10e5\u10d5\u10d4\u10dc\u10d8 \u10d5\u10d4\u10d1\u10d9\u10d0\u10db\u10d4\u10e0\u10d0. \u10e9\u10d5\u10d4\u10dc \u10d0\u10db \u10e4\u10dd\u10e2\u10dd\u10e1 \u10d7\u10e5\u10d5\u10d4\u10dc \u10de\u10d8\u10e0\u10d0\u10d3\u10dd\u10d1\u10d8\u10e1 \u10db\u10dd\u10ec\u10db\u10dd\u10d1\u10d0\u10d6\u10d4 \u10d0\u10e0\u10e1\u10d4\u10d1\u10e3\u10da \u10e4\u10dd\u10e2\u10dd\u10e1 \u10e8\u10d4\u10d5\u10d0\u10d3\u10d0\u10e0\u10d4\u10d1\u10d7.",
    "Used": "\u10d2\u10d0\u10db\u10dd\u10e7\u10d4\u10dc\u10d4\u10d1\u10e3\u10da\u10d8",
