    "Verification Checkpoint": "\u10e8\u10d4\u10db\u10dd\u10ec\u10db\u10d4\u10d1\u10d8\u10e1 \u10e1\u10d0\u10d9\u10dd\u10dc\u10e2\u10e0\u10dd\u10da\u10dd \u10ec\u10d4\u10e0\u10e2\u10d8\u10da\u10d8",
