    "Verified Certificate for {courseName}": "\u201e{courseName}\u201c \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1 \u10d3\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10d4\u10e0\u10d7\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8",
    "Verified Certificate upgrade": "\u10d3\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10d2\u10d0\u10dc\u10d0\u10ee\u10da\u10d4\u10d1\u10d0",
    "Verified Status": "\u10d3\u10d0\u10d3\u10d0\u10e1\u10e2\u10e3\u10e0\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10e2\u10d0\u10e2\u10e3\u10e1\u10d8",
    "Verified mode price": "\u10d3\u10d0\u10db\u10dd\u10ec\u10db\u10d4\u10d1\u10e3\u10da\u10d8 \u10e1\u10d4\u10e0\u10e2\u10d8\u10e4\u10d8\u10d9\u10d0\u10e2\u10d8\u10e1 \u10e4\u10d0\u10e1\u10d8",
    "Verify Now": "\u10d3\u10d0\u10d3\u10d0\u10e1\u10e2\u10e3\u10e0\u10d4\u10d1\u10d0",
    "Video Capture Error": "\u10d5\u10d8\u10d3\u10d4\u10dd \u10d2\u10d0\u10d3\u10d0\u10e6\u10d4\u10d1\u10d8\u10e1 \u10e8\u10d4\u10ea\u10d3\u10dd\u10db\u10d0",
    "Video ID": "\u10d5\u10d8\u10d3\u10d4\u10dd\u10e1 ID",
    "View": "\u10dc\u10d0\u10ee\u10d5\u10d0",
    "View Archived Course": "\u10d3\u10d0\u10d0\u10e0\u10e5\u10d8\u10d5\u10d4\u10d1\u10e3\u10da\u10d8 \u10d9\u10e3\u10e0\u10e1\u10d8\u10e1 \u10dc\u10d0\u10ee\u10d5\u10d0",
